expression = re.compile(rfc._ASCTIME_DATETIME_REGEX)
good_examples = ['Mon Jan  3 03:21:45 2045', 'Thu Oct 31 20:34:22 1982']
for good_example in good_examples:
    self.assertTrue(bool(expression.fullmatch(good_example)), msg=
        "Good asctime datetime '{d}' didn't match regex".format(d=good_example)
        )
